  {authors: "Seth Vargo", description: "Ruby is an excellent programming language for creating and managing custom DSLs, but how can you securely evaluate a DSL while explicitly controlling the methods exposed to the user? Our good friends instance_eval and instance_exec are great, but they expose all methods - public, protected, and private - to the user. Even worse, they expose the ability to accidentally or intentionally alter the behavior of the system! The cleanroom pattern is a safer, more convenient, Ruby-like approach for limiting the information exposed by a DSL while giving users the ability to write awesome code!", number: "1.0.0", rubygem_id: 110562, built_at: "2014-08-12 00:00:00", summary: "(More) safely evaluate Ruby DSLs with cleanroom", platform: "ruby", indexed: true, prerelease: false, position: 0, latest: true, full_name: "cleanroom-1.0.0", licenses: "---\n- Apache 2.0\n", size: 15360, requirements: "--- []\n", required_ruby_version: ">= 1.9.3", sha256: "tDq49tES6tyf6Hy38pD7L5h6Q+L5wE3G1koiIhZR2OQ=", metadata: {}, required_rubygems_version: ">= 0", yanked_at: nil, info_checksum: "ddc221da8d9b391c2abe0457db02b6eb", yanked_info_checksum: nil, pusher_id: nil},
